import React, { useState } from 'react';
import { Typography, Grid, Box, Button, TextField } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import BathroomIcon from '@mui/icons-material/Bathroom';
import LocalParkingIcon from '@mui/icons-material/LocalParking';

const PropertyDetailsRent = ({ property }) => {
  const [startDate, setStartDate] = useState('');
  const [months, setMonths] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    // Aquí puedes implementar la lógica para enviar la solicitud de renta
    console.log('Solicitud de renta:', { propertyId: property._id, startDate, months });
  };

  


  
  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        {property.location.address}
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <img src={property.images[0]} alt={property.location.address} style={{ width: '100%' }} />
        </Grid>
        <Grid item xs={12} md={6}>
          <Typography variant="body1" gutterBottom>
            {property.description}
          </Typography>
          <Box sx={{ mt: 2 }}>
            <Grid container spacing={1} alignItems="center">
              <Grid item>
                <HomeIcon /> {property.bedrooms}
              </Grid>
              <Grid item>
                <BathroomIcon /> {property.bathrooms}
              </Grid>
              {property.parking && (
                <Grid item>
                  <LocalParkingIcon />
                </Grid>
              )}
            </Grid>
          </Box>
          <Typography variant="h6" sx={{ mt: 2 }}>
            ${property.price}
          </Typography>
          {/* Formulario de renta */}
          <form onSubmit={handleSubmit}>
            <Grid container spacing={2} sx={{ mt: 2 }}>
              <Grid item xs={12} sm={6}>
                <TextField
                  label="Fecha de inicio"
                  type="date"
                  value={startDate}
                  onChange={(e) => setStartDate(e.target.value)}
                  InputLabelProps={{ shrink: true }}
                  fullWidth
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  label="Meses"
                  type="number"
                  value={months}
                  onChange={(e) => setMonths(e.target.value)}
                  fullWidth
                />
              </Grid>
              <Grid item xs={12}>
                <Button type="submit" variant="contained" fullWidth>
                  Solicitar Renta
                </Button>
              </Grid>
            </Grid>
          </form>
          {/* Calendario (puedes usar una librería de calendario) */}
        </Grid>
      </Grid>
    </Box>
  );
};

export default PropertyDetailsRent;
